Dinosaur Train is an American/Canadian/Singaporean animated series created by Craig Bartlett. Bartlett previously created Hey Arnold!, and worked on Rugrats, Sid the Science Kid, and the Penny cartoons for Pee-wee's Playhouse.

The series features a curious young Tyrannosaurus Rex named Buddy who, together with his adopted Pteranodon family, takes the Dinosaur Train to explore his time period, and have adventures with all kinds of dinosaurs. It is produced by The Jim Henson Company in association with Media Development Authority, Sparky Animation, FableVision, and Snee-Oosh, Inc.

