The world of Dinosaur Train is seen through the eyes of Buddy the Tyrannosaurus. In the showÃ¢â‚¬â„¢s main title song, we learn that Buddy was adopted by Mr. and Mrs. Pteranodon. He hatched at the same time as his pteranodon siblings Tiny, Shiny, and Don. By traveling in the Dinosaur Train around the Mesozoic, supplied with all dinosaur facts by the trainÃ¢â‚¬â„¢s Troodon Conductor, Buddy learns that he is a Tyrannosaurus. As an adopted kid in a mixed-species family, Buddy is curious about the differences between species and vows to learn about all the dinosaurs he can by riding the Dinosaur Train. The dinosaurs featured in the show are actual dinosaurs discovered by paleontologists.

